import Typewriter from "typewriter-effect";

export default function MainPage() {
    return (
        <>
            {/* <div className="px-4 py-5 my-5 text-center"> */}
            <h1 className="mx-auto display-1 nameText csep" width='50'>Welcome!</h1>
            <div className="mx-auto fs-2 siteText">
                <Typewriter
                    onInit={(typewriter) => {
                        typewriter
                            .typeString("My name is Adrian Dorado, avid doer of things.")
                            .pauseFor(1000)
                            .deleteAll()
                            .typeString("Contact me @ doradocoding@gmail.com")
                            .pauseFor(1000)
                            .deleteAll()
                            .typeString("I hope you enjoy your stay <3")
                            .start()
                    }}
                />
            </div>
            {/* <img align='right' src="./bun1.jpg" width="50%" height="auto" alt="no bun :(" /> */}
            <div className="carousel slide" data-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <img className="d-block w-100" width="50%" height="auto" src="./bun1.jpg" alt="First slide" />
                    </div>
                    <div className="carousel-item">
                        <img className="d-block w-100" src="./bun_logo_smol.png" width="50%" height="auto" alt="Second slide" />
                    </div>
                    {/* <div className="carousel-item">
                        <img className="d-block w-100" src="..." alt="Third slide" />
                    </div> */}
                </div>
            </div>
            {/* </div> */}
        </>
    );
}
